#nullable enable
namespace Risk.Resources;
public static class SvgPngImageResource
{
    private readonly static string _artilary = "data:image/svg+xml;base64,";
    public static string Artilary => "artilary.svg";
    private readonly static string _cavalry = "data:image/svg+xml;base64,";
    public static string Cavalry => "cavalry.svg";
    private readonly static string _infantry = "data:image/svg+xml;base64,";
    public static string Infantry => "infantry.svg";
    public static void Register()
    {
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("artilary.svg", _artilary);
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("cavalry.svg", _cavalry);
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("infantry.svg", _infantry);
    }
}